
DROP TABLE IF EXISTS tempCardTemplates;

CREATE TABLE tempCardTemplates (
    `order_del` VARCHAR(4) CHARACTER SET UTF8MB4,
    `templateId_gen` VARCHAR(31) CHARACTER SET UTF8MB4,
    `name` VARCHAR(29) CHARACTER SET UTF8MB4,
    `pitch` INT,
    `cost` INT,
    `varCost` VARCHAR(2) CHARACTER SET UTF8MB4,
    `power` INT,
    `varPower` VARCHAR(1) CHARACTER SET UTF8MB4,
    `defense` INT,
    `varDefense` INT,
    `intellect` INT,
    `life` INT,
    `handedness` INT,
    `legendary` INT,
    `class` VARCHAR(13) CHARACTER SET UTF8MB4,
    `type` VARCHAR(16) CHARACTER SET UTF8MB4,
    `subtypes` VARCHAR(12) CHARACTER SET UTF8MB4,
    `specialization` VARCHAR(9) CHARACTER SET UTF8MB4,
    `keywords` VARCHAR(39) CHARACTER SET UTF8MB4
);

